export default (state={}, action) => {
	switch (action.type) {
		case 'REGISTERED':
			return {
				...state, 
				authenticated: true, 
				user: action.payload
			}
		case 'REGISTER_ERROR':
			return {
				...state,
				registerError: action.payload
			}
		default:
			return state;
	}
}
